webpackJsonp([0xd7e1b376b82d],{1012:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-11-12-264/index.md absPath of file >>> MarkdownRemark",html:"<p>So if you are ever working oh so hard on a ruby on rails application and all of a sudden your application stops working and you have no idea why because the error looks like this:</p>\n<pre><code class=\"ruby\">\n/!\\ FAILSAFE /!\\  Mon Nov 12 17:27:15 -0700 2007\n  Status: 500 Internal Server Error\n  wrong number of arguments (1 for 0)\n    /Users/jbasdf/projects/indulge/vendor/rails/actionpack/lib/\naction_controller/base.rb:513:in `send'\n   .....\n</pre></code>\n<p>Step back.  Call yourself and idiot and remove the method you just added because you can't ever name a method 'send' in your controller because it overrides default functionality and then pukes all over the place.</p>\n<p>Bad programmer ... bad bad programmer.</p>",frontmatter:{title:"Stupid Error That I will Blame on Lack of Sleep",date:"November 12, 2007",imageUrl:null,structuredHtml:null,image:null}}},pathContext:{path:"/264"}}}});
